import React from "react";
import { NavLink } from "react-router-dom";

function Menu() {
    return (
        <>
        <NavLink to={'/'}>
            About 
        </NavLink>

        <div>
            Using anchor Tag
            <a href="/">
                About Us
            </a>
            <a href="/contact">
                Contact
            </a>
            </div>
        </>
    )
}
export default Menu;
